import React from 'react';
import './Home.css';

function Home() {
    const bannerImageUrl = "https://pacinst.org/wp-content/uploads/2020/01/cornfield-compressed.jpg";
    return (
        <div className="page-container">
            <img src={bannerImageUrl} alt="banner image" />
        </div>
    )
}

export default Home
